public class Division implements Operaciones {
	/**
	 * declaran variables necesarias en formato double para realizar una division
	 */
	@Override
	public double operaciones(double n1, double n2) {
		// TODO Auto-generated method stub
		return n1 / n2;
	}
	/**
	 * declaracion de variables vacias
	 */
	@Override
	public int operaciones(int n1, int n2) {
		// TODO Auto-generated method stub
		return 0;
	}


}
